description:
The Class J50 for Train Simulator, developed by Meshtools, is available in a number of British Railways and LNER liveries, including BR Green, BR Early, BR Late, BR Mid, LNER Black and LNER Green. Features of the locomotive include standard and advanced driving controls, with extra scripting on the advanced controls to depict vacuum brakes, dampers, notched reverser, exterior animations and controller emitters. 

The locomotive is also Quick Drive compatible, giving you the freedom to drive the BR/LNER Class J50 on any Quick Drive enabled route for Train Simulator. Also included are scenarios specifically for the Western Lines of Scotland route (available separately and required to play these scenarios).


Please support the developers and buy some of their content if you can afford it.


Please use the email address or the facebook fanpage for requests, questions and also if you want to share an addon with the community which we will post on your behalf.

If you would like to contribute, please read the Readme.pdf.


